import React, { Component } from 'react';
import App from './views/App';
import UIGraph from './UIGraph';
import dynamics from '../src/index';
import bezierDefaults from './bezierDefaults';

export default class Editor extends Component {
	constructor() {
		super();

		this.state = {
			tick: 0,
			settings: [],
			circles: {},
			duration: 1000,
			name: 'spring',
		};
	}

	onCanvas = canvas => {
		if (!canvas) return;

		this.graph = new UIGraph(canvas);
		this.graph.pointsChanged = this.onUpdate;
		this.onRefresh();
	}

	onSelect = e => {
		const { value } = e.target;
		this.setState({ name: value });
		this.onRefresh(value);
	}

	onRefresh(name = this.state.name) {
		if (name === 'bezier') {
			this.graph.points = bezierDefaults();
			this.graph.editable = true;
		} else {
			this.graph.points = undefined;
			this.graph.editable = false;
		}

		this.curve = dynamics[name];
		this.values = { ...this.curve.defaults };

		this.setState({ settings: this.createSettings() });
		this.onUpdate();
	}

	onUpdate = (name, value) => {
		if (name) {
			const obj = this.state.settings[name];
			this.setState({
				...this.state.settings,
				[name]: {
					...obj,
					value,
				},
			});
		}

		if (this.graph.points) {
			this.values.points = this.graph
				.points
				.slice()
				.sort((left, right) => left.x < right.x ? -1 : 1);
		} else {
			this.values.points = undefined;
		}

		this.graph.curve = this.curve(this.values);
		this.graph.draw();

		this.startAnimationDelayed();
	}

	createSettings() {
		return [
			{
				min: 100,
				max: 5000,
				value: this.state.duration,
				property: 'duration',
				onUpdate: this.onUpdate
			},
			...this.curve.defaults ? 
				Object.keys(this.curve.defaults)
					.map(key => {
						const value = this.curve.defaults[key];
						return {
							min: value === 0 ? 0 : 1,
							max: 1000,
							value: this.values[key],
							property: key,
							onUpdate: this.onUpdate,
						};
					}) : []
		].reduce((memo, node) => {
			const { property } = node;
			memo[property] = node;
			return memo;
		}, {});
	}

	startAnimationDelayed() {
		this.delayedAnimation = setTimeout(this.startAnimation, 100);
	}

	startAnimation = () => {
		const existingCircles = this.state.circles;
		Object.keys(existingCircles)
			.forEach(key => {
				const circle = existingCircles[key];
				if (circle.dying) return;

				circle.dying = true;
				const { id } = circle;
				dynamics.animate({ opacity: 1 }, { opacity: 0 }, {
					id,
					type: 'easeInOut',
					duration: 100,
				})
					.on('change', ({ transform }) => {
						this.setState({
							circles: {
								...this.state.circles,
								[id]: {
									...circle,
									transform,
								},
							},
						});
					})
					.on('complete', () => {
						const circles = this.state.circles;
						delete circles[id];
						this.setState({ circles });
					});
			});

		clearTimeout(this.restartAnimationTimeout);
		const initialForce = this.curve(this.values).initialForce;

		const circle = dynamics.animate({ scale: 0 }, { scale: 1 }, {
			type: 'spring',
			friction: 300,
			duration: 800,
		})
			.on('change', ({ transform }) => {
				this.setState({
					circles: {
						...this.state.circles,
						[circle.id]: {
							...circle,
							transform,
						},
					},
				});
			})
			.on('complete', () => {
				dynamics.animate({ translateX: 0 }, { translateX: 350 }, {
					...this.values,
					...{
						id: circle.id,
						type: this.curve.type,
						duration: this.state.duration,
						delay: 250,
					}
				})
					.on('change', ({ transform }) => {
						this.setState({
							circles: {
								...this.state.circles,
								[circle.id]: {
									...circle,
									transform,
								},
							},
						});
					})
					.on('complete', () => {
						this.restartAnimationTimeout = dynamics.setTimeout(this.startAnimation, 300);

						dynamics.animate({ translateX: 350 }, {
							translateX: initialForce ? 0 : 350,
							scale: 0.01
						}, {
							id: circle.id,
							type: 'easeInOut',
							duration: 100,
							delay: 100,
						})
							.on('change', ({ transform }) => {
								this.setState({
									circles: {
										...this.state.circles,
										[circle.id]: {
											...circle,
											transform,
										},
									},
								});
							})
							.on('complete', () => {
								const circles = this.state.circles;
								delete circles[circles.id];
								this.setState({ circles });
							});
					});
			});

		this.setState({
			circles: {
				...this.state.circles,
				[circle.id]: circle,
			}
		});
	}

	render() {
		return (
			<App
				{ ...this.state }
				onCanvas={ this.onCanvas }
				onSelect={ this.onSelect }
				onSettings={ this.onUpdate }
			/>
		);
	}
};
